  function Invoke-ParseJSONArray($) 
     {
       $ = @()
       $ = [systeM.DIAgnostICs.stOpWatch]::StartNew()
       $I = 0

    $ | ForEach-Object -Process {

if($.Elapsed.TotalMilliseconds -ge 500)
 {
      $ = [Math]::Truncate($I / $.count * 100)

       if($ -le 100)
        {
Write-Progress -Activity "Parsing JSON" -Status "$% Complete:" -PercentComplete $ -ErrorAction SilentlyContinue
}

         $.Reset()
       $.Start()
 }

  $I++
     $ += , (Invoke-ParseItem $_)}

    return $
        }

